pragma solidity ^0.5.0;

contract Marketplace {
    uint public AssetCount = 0;
    mapping(uint => Asset) public Assets;

    struct Asset {
        uint id;
        string productName;
        string ownerName;
        uint price;
        string cnicNumber;
        string creationYear;
        string buyingYear;
        address payable ownerAddress;
        bool purchased;
    }

    event AssetCreation(
        uint id,
        string productName,
        string ownerName,
        uint price,
        string cnicNumber,
        string creationYear,
        string buyingYear,
        address payable ownerAddress,
        bool purchased
    );

    event AssetPurchasing(
        uint id,
        string productName,
        string ownerName,
        uint price,
        string cnicNumber,
        string creationYear,
        string buyingYear,
        address payable ownerAddress,
        bool purchased
    );

    constructor() public {
    }

    function createAsset(string memory _ownerName,string memory _productName,string memory cnicNumber,string memory _creationYear, string memory _buyingYear, uint _price) public {
        // Require a valid price
        require(_price > 0);
        // Increment Asset count
        AssetCount++;
        // Create the Asset
        Assets[AssetCount] = Asset(AssetCount,_productName, _ownerName, _price,cnicNumber, _creationYear,_buyingYear, msg.sender, false);
        // Trigger an event
        emit AssetCreation(AssetCount,_productName, _ownerName, _price,cnicNumber, _creationYear,_buyingYear, msg.sender, false);

    }

    function purchaseAsset(uint _id, string memory ownerName,string memory _productName ,uint price, string memory cnicNumber,string memory buyingYear) public payable {
        // Fetch the Asset
        Asset memory _asset = Assets[_id];
        // Fetch the ownerAddress
        address payable _seller = _asset.ownerAddress;
        _asset.ownerAddress = msg.sender;
        _asset.purchased = true;
        Assets[_id] = _asset;
        address(_seller).transfer(_asset.price);
        emit AssetPurchasing(AssetCount,_productName, ownerName, price,cnicNumber, _asset.creationYear, buyingYear, msg.sender, true);
    }
}
